, egg. need for teacher or coach to help you progress.',26,_binary '\0',NULL,NULL,NULL),(166,_binary '\0','Working Conditions: Refers to having a safe position and nice place to work, you should be free to do your task, get reward for your work and not having fear of losing job.',26,_binary '\0',NULL,NULL,NULL),(167,_binary '\0','Agriculture: Agriculture includes the methods and techniques used in farming to produce food and raw materials.',27,_binary '\0',NULL,NULL,NULL),(168,_binary '\0','Art: Art studies how people express their creativity through painting, music, and storytelling.',27,_binary '\0',NULL,NULL,NULL),(169,_binary '\0','Cultural Studies: Cultural studies help in understanding how culture shapes society, identity, and daily life through traditions, beliefs, and practices.',27,_binary '\0',NULL,NULL,NULL),(170,_binary '\0','English: The study of the English language teaches grammar rules, vocabulary expansion, and the analysis of literature and texts.',27,_binary '\0',NULL,NULL,NULL),(171,_binary '\0','Home and Consumer Science: This subject teaches useful skills and knowledge for taking care of the home and family. It provides information on managing daily tasks, choosing a healthy diet, and keeping the family happy and healthy.',27,_binary '\0',NULL,NULL,NULL),(172,_binary '\0','Finance: The study of finance teaches money management, saving, investing, and planning expenses.',27,_binary '\0',NULL,NULL,NULL),(173,_binary '\0','Health: Health education includes information about nutrition, exercise, hygiene, and mental well-being.',27,_binary '\0',NULL,NULL,NULL),(174,_binary '\0','Languages: Language education involves learning to read, write, speak, and understand different languages.',27,_binary '\0',NULL,NULL,NULL),(175,_binary '\0','Management: The study of management teaches how to plan projects, lead teams, make decisions, and solve problems in various organizations.',27,_binary '\0',NULL,NULL,NULL),(176,_binary '\0','Mathematics: Mathematics in