INSERT INTO `assessment_questions` VALUES (6,5,'Below is a list of 15 broad fields of study commonly pursued in India. Your task is to select the top 5 areas that resonate most deeply with your interests and aspirations. If you need clarification on the meaning of any field, please refer to the help section provided.','multiple-choice',2,NULL),(9,1,'In a timed class test or quiz…','multiple-choice',4,NULL),(10,1,'When shopping, if I get ₹250 and spend ₹185, I…','multiple-choice',4,NULL),(11,1,'In a storytelling or creative writing task…','multiple-choice',4,NULL),(12,1,'In a vocabulary quiz or crossword…','multiple-choice',4,NULL),(13,1,'When learning about how things work, like engines or computers..','multiple-choice',4,NULL),(14,1,'When faced with a disagreement among friends…','multiple-choice',4,NULL),(15,1,'When doing crafts like origami or model-making…','multiple-choice',4,NULL),(16,1,'When designing a poster or artwork…','multiple-choice',4,NULL),(17,1,'When playing strategy games like chess or other video games…','multiple-choice',4,NULL),(18,1,'When participating in a sport (e.g., basketball, kho-kho)…','multiple-choice',4,NULL),(26,5,'Your values play a crucial role in guiding your behaviour and decisions. They give direction to your\nlife and career, helping you decide who you are and how you interact with the world. Below are 15 values. Your\ntask is to select the top 5 values that are most important to you.','multiple-choice',3,_binary '\0'),(27,5,'Below is a list of 15 broad fields of study commonly pursued in India. Your task is to select the top\n5 areas that resonate most deeply with your interests and aspirations.','multiple-choice',3,_binary '\0'),(28,1,'I prefer learning through practical experiments rather\nthan just listening to lectures.','multiple-choice',5,_binary '\0'),(29,1,' I like to participate in debates or discussions to\nexplore different viewpoints.','multiple-choice',5,_binary '\0'),(30,1,' I like to participate in art or drama competition in\nschool.','multiple-choice',5,_binary '\0'),(31,1,' I enjoy social gatherings just to be with people.','multiple-choice',5,_binary '\0'),(32,1,'I like planning birthday parties and get-togethers with\nfriends.','multiple-choice',5,_binary '\0'),(33,1,' I like keeping my school notes and textbooks neatly\norganized.','multiple-choice',5,_binary '\0'),(34,1,'During exam…','multiple-choice',9,_binary '\0'),(35,1,'To calculate daily math with two digit numbers (+.,-,*,/)\n…','multiple-choice',9,_binary '\0'),(36,1,'Given a blank piece of paper..','multiple-choice',9,_binary '\0'),(37,1,' When learning new language?','multiple-choice',9,_binary '\0'),(38,1,'Setting up and configuring new devices, like printers,\nelectric games, or smart home gadgets...','multiple-choice',9,_binary '\0'),(39,1,'I play a sport or dance','multiple-choice',10,_binary '\0'),(40,1,' I can throw things well - darts, skimming pebbles,\nfrisbees, etc .','multiple-choice',10,_binary '\0'),(41,1,' I enjoy and am good at making things - I\'m good with\nmy hands.','multiple-choice',10,_binary '\0'),(42,1,'I find it easy to talk to new people','multiple-choice',10,_binary '\0'),(43,1,' It upsets me to see someone cry and not be able to\nhelp.','multiple-choice',10,_binary '\0'),(44,1,'Kuch TOh','multiple-choice',2,NULL),(45,1,'asd','single-choice',2,NULL),(46,0,'Game 1','multiple-choice',12,_binary '\0'),(47,0,'Game 2','multiple-choice',12,_binary '\0'),(48,0,'Game 3','multiple-choice',12,_binary '\0'),(49,1,'QUESTION Demo','multiple-choice',13,_binary '\0'),(50,1,'DEMO 1','multiple-choice',14,_binary '\0'),(52,1,'Meera gets a haircut she hates. Her friend, not knowing Meera hates it, says, \"Wow, that\'s a very bold choice!\" Did the friend mean to be mean to Meera?','multiple-choice',16,NULL),(53,1,'Rahul tells his friend, \"Great job dropping that catch,\" in a grumpy voice after they lose the game. Does Rahul actually think his friend did a good job?','multiple-choice',16,NULL),(54,1,'Diya tells Sona a secret. Later, Sona mentions it in front of others, forgetting it was a secret. Why did Sona mention the secret to the group?','multiple-choice',16,NULL),(55,1,'Sameer forgot his lunch. His friend says, \"I have way too much food today anyway,\" and shares it. Why did the friend say she had \"too much\" food?','multiple-choice',16,NULL),(56,1,'Ishaan hides a game so his brother doesn\'t find it, but the brother saw where it was hidden. What does Ishaan think his brother is doing?','multiple-choice',16,NULL),(57,1,'A teacher calls a student by the wrong name on the first day of school. Why did the teacher use the wrong name?','multiple-choice',16,NULL),(58,1,'Kabir hides a toy in the Blue Box. He knows his sister thinks he always lies. When she asks, he tells the truth: \"It\'s in the Blue Box. \"Why did Kabir tell the truth?','multiple-choice',16,NULL),(59,1,'Riya finds her mother’s hidden chocolates. She eats one but makes sure the wrapper is hidden deep in the bin so no one sees it. What is Riya’s main goal in hiding the wrapper?','multiple-choice',16,NULL),(60,1,'Aditi is playing video games while her laundry is piled on the bed. Her mother walks in and asks, \"Is this room a new art museum for clothes?\"','multiple-choice',16,NULL),(61,3,'Look at the list below. Pick 3 things that are most important to you. Put a 1 next to the most important, a 2 next to the second, and a 3 next to the third.','ranking',17,NULL),(62,1,'Some kids...','single-choice',19,NULL),(63,1,'Some kids...','single-choice',19,NULL),(64,1,'Some kids...','single-choice',19,NULL),(65,1,'Some kids...','single-choice',19,NULL),(66,1,'Some kids...','single-choice',19,NULL),(67,1,'Some kids...','single-choice',19,NULL),(68,1,'Some kids...','single-choice',19,NULL),(69,1,'Some kids...','single-choice',19,NULL),(70,1,'Some kids...','single-choice',19,NULL),(71,1,'Some kids...','single-choice',19,NULL),(72,1,'Some kids...','single-choice',19,NULL),(73,1,'Some kids...','single-choice',19,NULL),(74,1,'Some kids...','single-choice',19,NULL),(75,1,'Some kids...','single-choice',19,NULL),(76,1,'Some kids...','single-choice',19,NULL),(77,1,'Some kids...','single-choice',19,NULL),(78,1,'Some kids...','single-choice',19,NULL),(79,1,'Some kids...','single-choice',19,NULL),(80,1,'Some kids...','single-choice',19,NULL),(81,1,'Some kids...','single-choice',19,NULL),(82,1,'Some kids...','single-choice',19,NULL),(83,1,'Some kids...','single-choice',19,NULL),(84,1,'Some kids...','single-choice',19,NULL),(85,1,'Some kids...','single-choice',19,NULL),(86,1,'Some kids...','single-choice',19,NULL),(87,1,'Some kids...','single-choice',19,NULL),(88,1,'Some kids...','single-choice',19,NULL),(89,1,'Some kids...','single-choice',19,NULL),(90,1,'Some kids...','single-choice',19,NULL),(91,1,'Some kids...','single-choice',19,NULL),(92,1,'Some kids...','single-choice',19,NULL),(93,1,'Some kids...','single-choice',19,NULL),(94,1,'Some kids...','single-choice',19,NULL),(95,1,'Some kids...','single-choice',19,NULL),(96,1,'Some kids...','single-choice',19,NULL),(97,1,'Some kids...','single-choice',19,NULL),(98,1,'Some kids...','single-choice',19,NULL),(99,3,'nullified\n','ranking',17,NULL),(100,0,'Lion Game','single-choice',20,NULL),(101,0,'Rabbit Path','single-choice',21,_binary '\0'),(102,0,'Hydro Tube Game','single-choice',22,_binary '\0'),(103,4,'Look at these 8 pictures. Tap the 4 pictures that look most like what you usually do or choose in your daily life. ','multiple-choice',18,NULL);
