INSERT INTO `language_question` VALUES (22,'नीचे भारत में सामान्यतः अपनाए जाने वाले 15 व्यापक अध्ययन क्षेत्रों की सूची दी गई है। आपका कार्य उन शीर्ष 5 क्षेत्रों का चयन करना है जो आपकी रुचियों और आकांक्षाओं से सबसे अधिक मेल खाते हों। यदि आपको किसी फ़ील्ड के अर्थ पर स्पष्टीकरण की आवश्यकता है, तो कृपया दिए गए सहायता अनुभाग को देखें।',6,1,NULL),(23,'MARATHI CHe',6,2,NULL),(24,'मुझे केर्ि भाषर् (भाषर्) िुनने के बजाय, प्रयोग करके िीखना ज़्यािा पिंि है।',28,1,NULL),(25,'मुझे अिग-अिग वर्िार जानने के लिए र्ाि-वर्र्ाि (debates) या ििाव (discussions) में भाग िेना पिंि है।',29,1,NULL),(26,'मुझे स्कूि में किा (art) या नाटक (drama) की प्रनियोचगिा में भाग िेना पिंि है।',30,1,NULL),(27,'मुझे िोगों के िाथ रहने के लिए िामास्जक िमारोहों (social gatherings) में शालमि होना अच्छा िगिा है।',31,1,NULL),(28,' मुझे िोस्िों के िाथ जन्मदिन की पाटी या छोटे-मोटे िमारोह की योजना बनाना अच्छा िगिा है।',32,1,NULL),(29,'मुझे अपनी स्कूि की कॉपी और ककिाबों को अच्छे िे जमाकर रखना अच्छा िगिा है।',33,1,NULL),(30,'परीक्षा के दौरान...',34,1,NULL),(31,'दो अंकों की संख्याओं के सार् रो ाना गणर्ि की गर्ना करने के लिए (+, -, *, /)...',35,1,NULL),(32,'एक खाली कागज का टुकडा ममलने पर...',36,1,NULL),(33,'जब नई भािा सीख रहे हों?',37,1,NULL),(34,'नए डडर्ाइि, जैिे वप्रंटर, इिेस्क्िक गेम या स्माटव होम गैजेट िेट अप और कॉस्न्फ़गर करना...',38,1,NULL),(35,'मैंएक खेल खेलता ह ँया नृत्य करता ह ँ।',39,1,NULL),(36,'मैंषवमभन्न चीजों को अच्छी तरह र्ें क सकता ह ँ - जैसे र्ा्थस, पत्र्र को पानी पर उछालना, किस्बी आहद।',40,1,NULL),(37,'मैंचीजेंबनानेका आनंद लेता ह ँऔर उसमें कुशल ह ँ - मैंअपने हार्ों से काम करने में ननपुण ह ँ।',41,1,NULL),(38,'मुझे नए लोगों से बात करना आसान लगता है।',42,1,NULL),(39,'ककसी को रोते हुए देखना और उनकी मदद न कर पाना मुझे दुखी करता है।',43,1,NULL);
